window.bookSummaryJSON = "<p><b>I thought we'd faced the worst possible horrors already. I was wrong.</b><br> <br> My men and I have fought the guardians who held us captive for so long. Refused to let them harness our powers yet again.<br> <br> But there's another villain lurking in the shadows. One who doesn't even pretend to care about anyone's interests other than his own.<br> <br> With every move he makes, I feel one step closer to breaking. How can we ever escape while a man like this controls our future?<br> <br> The path to freedom could lie in the past we left behind. But our history holds secrets that are just as likely to destroy me....</p>"; 
